package com.baotoan.spring.entities;

public class OrderStatistic {
	private Object x;
	private Object y;

	public OrderStatistic() {
		// TODO Auto-generated constructor stub
	}

	public OrderStatistic(Object x, Object y) {
		super();
		this.x = x;
		this.y = y;
	}

	public Object getX() {
		return x;
	}

	public void setX(Object x) {
		this.x = x;
	}

	public Object getY() {
		return y;
	}

	public void setY(Object y) {
		this.y = y;
	}

}
